import React from "react";
import {Container, Navbar, NavbarBrand} from "react-bootstrap"
import "./img/logo.svg";

export function TopNav(){
    return(
        
            <Navbar bg="dark" variant="dark" collapseOnSelect>
                <Container>
                <Navbar.Brand>
                    <img
                        alt="Xepelin logo"
                        src="/img/logo.svg"
                        width="30"
                        height="30"
                        className="d-inline-block align-top"
                    />{' '}
                </Navbar.Brand>
                </Container>
            </Navbar>
    )
}
